<span class="line"><span style="color:#D4D4D4;">   </span><span style="color:#DCDCAA;">molecular_weight:</span><span style="color:#D4D4D4;"> </span><span style="color:#B5CEA8;">44.05</span><span style="color:#D4D4D4;"> </span><span style="color:#9CDCFE;">g</span><span style="color:#D4D4D4;">/</span><span style="color:#9CDCFE;">mol</span><span style="color:#D4D4D4;">;</span></span>
